-- All units derived from: https://create.roblox.com/docs/physics/units -- Converting from the SI unit to the Roblox unit local Units = {}
Units.Mass_kg = 0.0456 -- Mass in kilograms (kg) Units.Length_mm = 280 -- Length in milimetres (mm) Units.Force_N = .163 -- Force in Newtons (N) Units.Stiffness_Ndivm = Units.Mass_kg -- Stiffness in Newtons per metre (N/m) Units.Damping_N_sdivm = Units.Mass_kg -- Damping in Newton-seconds per metre (N*s/m) Units.Velocity_mdivs = 1/(Units.Length_mm/1000) -- Velocity in metres per second (m/s) Units.Torque_nm = Units.Force_N/(Units.Length_mm/1000) -- Torque in Newton-metres (Nm) return Units

